export const ADD_TO_CART = 'ADD__CART'
export const CLEAR__CART = 'CLEAR__CART'
export const INITIAL__SPECIFIC__BOOK = "INITIAL";
export const SIGNIN = "SIGNIN";
export const SIGNOUT = "SIGNOUT";


export const fetchBooks = (payload) => ({
    type: INITIAL__BOOKS,
    payload
});
